    console.log(this.state)
    return (
      <div className="container">
        <div scr={banner} className="hero-image">
        <div className="hero-text">
          <h1>I am John Doe</h1>
          <p>And I'm a Photographer</p>
          <button>Hire me</button>
        </div>
      </div>
      </div>

    );
  }

}

